response.about:
Счастливые леди 
Не думают матом, 
Закутавшись в пледе, 
Бессильно 
измятом; 

Не лечатся виски; 
Не спят с телефоном; 
Не тянуться к риску; 
Не курят с балкона; 

Не дышат устало 
Чужим 
никотином; 
Не спят с кем попало; 
Не пьют аспирина; 

Не льют 
мимо чашки, 
Чтоб выпить таблеток; 
Не ходят в рубашке 
В измятую клетку; 

Не рвут фотографий; 
Не ищут патрона; 
Не плачут ночами 
До хрипа и стона; 

Не пишут «ответь мне»; 
Не верят, как дети; 
Счастливые леди – 
Их нет в Интернете...
